package com.softeem.dto;

import java.util.Date;

/**
 * ÓÃ»§DTO
 * 
 * @author Administrator
 *
 */
public class User {

	private int id;
	private String username;
	private String password;
	private String nickName;
	private String desciption;
	private String email;
	private Date registerTime;
	private Date lastLoadTime;
	private Head headImg;
	private int acount;
	
	public User() {
		// TODO Auto-generated constructor stub
	}

	public User(int id, String username, String password, String nickName, String desciption, String email,
			Date registerTime, Date lastLoadTime, Head headImg, int acount) {
		super();
		this.id = id;
		this.username = username;
		this.password = password;
		this.nickName = nickName;
		this.desciption = desciption;
		this.email = email;
		this.registerTime = registerTime;
		this.lastLoadTime = lastLoadTime;
		this.headImg = headImg;
		this.acount = acount;
	}

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public String getUsername() {
		return username;
	}

	public void setUsername(String username) {
		this.username = username;
	}

	public String getPassword() {
		return password;
	}

	public void setPassword(String password) {
		this.password = password;
	}

	public String getNickName() {
		return nickName;
	}

	public void setNickName(String nickName) {
		this.nickName = nickName;
	}

	public String getDesciption() {
		return desciption;
	}

	public void setDesciption(String desciption) {
		this.desciption = desciption;
	}

	public String getEmail() {
		return email;
	}

	public void setEmail(String email) {
		this.email = email;
	}

	public Date getRegisterTime() {
		return registerTime;
	}

	public void setRegisterTime(Date registerTime) {
		this.registerTime = registerTime;
	}

	public Date getLastLoadTime() {
		return lastLoadTime;
	}

	public void setLastLoadTime(Date lastLoadTime) {
		this.lastLoadTime = lastLoadTime;
	}

	public Head getHeadImg() {
		return headImg;
	}

	public void setHeadImg(Head headImg) {
		this.headImg = headImg;
	}

	public int getAcount() {
		return acount;
	}

	public void setAcount(int acount) {
		this.acount = acount;
	}
	
	

}
